export const SECRET = store.get("user") ? store.get("user").secretKey : "";
export const ADMIN_ID = store.get("user") ? store.get("user").adminKey : "";

export const USERS = {
  LOGIN: "/user/login/3"
};

/* ------------------------------- CATEGORY API ------------------------------- */

export const CATEGORY = {
  GET_CATEGORY: "/service/category?admin_id=3",
  ADD_CATEGORY: "/service/add-category?admin_id=3",
  PATCH_CATEGORY: "/service/edit-category"
};

/* ------------------------------- SERVICES API ------------------------------- */

export const SERVICES = {
  GET_SERVICE: "/service?admin_id=20",
  GET_SERVICE_BY_ID: "/service?admin_id=20&service_name=bike service",
  ADD_SERVICE: "/service/add-service?admin_id=20",
  PATCH_SERVICE: "/service/edit-service"
};

/* ------------------------------- SERVICE TYPES API ------------------------------- */

export const SERVICE_TYPES = {
  GET_SERVICE_TYPE: "/service/type-of-service?admin_id=20",
  GET_SERVICE_BY_ID:
    "//service/type-of-service?admin_id=20&type=General Service",
  ADD_SERVICE_TYPE:
    "/service/add-type-of-service/5f7c8564c470ae00a9d02b5e?admin_id=20"
};

/* ------------------------------- VEHICLE API ------------------------------- */

export const VEHICLE = {
  GET_VEHICLE: "/vehicle?admin_id=20",
  GET_VEHICLE_BY_ID: "/vehicle?admin_id=20",
  ADD_VEHICLE: "/vehicle/add-vehicle?admin_id=20",
  PATCH_VEHICLE: "/vehicle/edit-vehicle"
};

/* ------------------------------- DESCRIPTION API ------------------------------- */

export const DESCRIPTION = {
  ADD_DESCRIPTION: "/service/add-description?admin_id=20",
  PATCH_DESCRIPTION:
    "/service/edit-description/changeField?admin_id=20&description_id=5f7cc88f574f16287d73d74c"
};
/* ------------------------------- VENDOR API ------------------------------- */

export const VENDOR = {
  GET_VENDOR: "/vendor?admin_id=20",
  ADD_VENDOR: "/vendor/add-vendor?admin_id=20",
  PATCH_VENDOR: "/vendor/edit-vendor"
};

/* ------------------------------- ORDERS API ------------------------------- */

export const ORDERS = {
  GET_ORDERS: "/order-details?admin_id=20"
};
